import { Component } from 'react';


class CreateDataset extends Component {
    state = {
            serverUrl: 'http://localhost:5220/dataset',
            isLoaded: false,
            error: '',
            datasetOriginalJSON: JSON,
            datasetUserInputJSON: JSON,
        };

    componentDidMount() {

    }

    fetchData() {
        console.log("Fetch data")
        try {
            fetch(this.state.serverUrl)
                .then(res => res.json())
                .then(
                    (result) => {
                        console.log(JSON.stringify(result.items[0]));

                        this.setState({
                            isLoaded: true,
                            datasetOriginalJSON: result.items[0]
                        });
                    },
                    (error) => {
                        this.setState({
                            isLoaded: false,
                            error
                        });
                    }
                )
        } catch (error) {
            console.error(error);
        }
    }


    handleChange(e: React.FormEvent<HTMLInputElement>) {
        e.defaultPrevented
        this.setState(
            {datasetUserInputJSON : e.currentTarget.value}
        )
    }

    handelSubmitRequest() {
        console.log('You clicked submit.');
        console.log(JSON.stringify(this.state.datasetUserInputJSON))
    }

    render() {
        return (
            <div>
                <h2>Create Or Update Dataset</h2>
                <form onSubmit={this.handelSubmitRequest}>
                    <label>
                        <textarea defaultValue={JSON.stringify(this.state.datasetOriginalJSON)} onChange={this.handleChange}/>
                    </label>
                    <input type="submit" value="Submit JSON" />
                </form>
            </div>
        )
    }

}

export default CreateDataset
